/*********************************************************************
*
*       _GetImageById
*/
const void * _GetImageById(U32 Id, U32 * pSize) {
  switch (Id) {
  case ID_IMAGE_0_IMAGE_0:
    *pSize = sizeof(_acImage_0);
    return (const void *)_acImage_0;
  case ID_IMAGE_1_IMAGE_0:
    *pSize = sizeof(_acImage_1);
    return (const void *)_acImage_1;
  case ID_IMAGE_2_IMAGE_0:
    *pSize = sizeof(_acImage_2);
    return (const void *)_acImage_2;
  }
  return NULL;
}

/*********************************************************************
*
*       program_gui_init
*/
void program_gui_init(void)
{
	/* Initialize TIMER 3 and the CRC CLOCK for the GUI */
	tim3_init();
	__HAL_RCC_CRC_CLK_ENABLE(); /* Enable the CRC Module */

	/* Initialize GUI */
	GUI_Init();

	GUI_Initialized = 1;

	/* Activate the use of memory device feature */
	WM_SetCreateFlags(WM_CF_MEMDEV);
	WM_MULTIBUF_Enable(1);
}

/*********************************************************************
*
*       SHOW GUI
*/
void gui_task(void) {
	CreateWindow();
}

/*********************************************************************
*
*       _cbDialog
*/
void wincallback(WM_MESSAGE * pMsg) {
  const void * pData;
  WM_HWIN      hItem;
  U32          FileSize;
  int          NCode;
  int          Id;
  // USER START (Optionally insert additional variables)
  // USER END

  switch (pMsg->MsgId) {
  case WM_INIT_DIALOG:
    //
    // Initialization of 'Window'
    //
    hItem = pMsg->hWin;
    WINDOW_SetBkColor(hItem, GUI_MAKE_COLOR(0x0000F0FF));
    //
    // Initialization of 'Button'
    //
    stop_butt = WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0);
    BUTTON_SetText(stop_butt, "STOP");
    BUTTON_SetFont(stop_butt, GUI_FONT_20B_1);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0);
    pData = _GetImageById(ID_IMAGE_0_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_1);
    pData = _GetImageById(ID_IMAGE_1_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Text'
    //
    logo_text = WM_GetDialogItem(pMsg->hWin, ID_TEXT_0);
    TEXT_SetTextAlign(logo_text, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetText(logo_text, "Liwiro");
    TEXT_SetFont(logo_text, GUI_FONT_16B_1);
    //
    // Initialization of 'Image'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_2);
    pData = _GetImageById(ID_IMAGE_2_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    // USER START (Optionally insert additional code for further widget initialization)
    // USER END
    break;
  case WM_NOTIFY_PARENT:
    Id    = WM_GetId(pMsg->hWinSrc);
    NCode = pMsg->Data.v;

	int length;
	char str[50];

    switch(Id) {
    case ID_IMAGE_2:// Notifications sent by 'Image'
		switch(NCode) {
		case WM_NOTIFICATION_CLICKED:
			length = clicked_circle();
			if(length <= CIRCLE_R){
				send_message(length);
				GUI_SetColor(GUI_WHITE);
				GUI_DrawCircle(ts.touchX[0], ts.touchY[0], 10);
			}
			break;
		}
		break;
    case ID_BUTTON_0: // Notifications sent by 'Button'
      switch(NCode) {
      case WM_NOTIFICATION_CLICKED:

    	  sprintf(str, "connect");
    	  TEXT_SetText(logo_text, (const char*)str);

//    	  connect_to_server(&client_socket, SERVER_PORT, SERVER_IP);

        // USER START (Optionally insert code for reacting on notification message)
        // USER END
        break;
      case WM_NOTIFICATION_RELEASED:
        // USER START (Optionally insert code for reacting on notification message)
        // USER END
        break;
      // USER START (Optionally insert additional code for further notification handling)
      // USER END
      }
      break;
    // USER START (Optionally insert additional code for further Ids)
    // USER END
    }
    break;
  // USER START (Optionally insert additional message handling)
  // USER END
  default:
    WM_DefaultProc(pMsg);
    break;
  }
}

WM_HWIN CreateWindow(void)
{
  WM_HWIN hWin;
  hWin = GUI_CreateDialogBox(_aDialogCreate, GUI_COUNTOF(_aDialogCreate), wincallback, WM_HBKWIN, 0, 0);
  return hWin;
}
